import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { retrieveCaughtPokemonAction } from "../actions/catchPokemonAction";

const MyPokemon = ({ userId }) => {
  const dispatch = useDispatch();
  const [pokemonCaught, setPokemonCaught] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const data = await dispatch(retrieveCaughtPokemonAction(userId));
        if (data && Array.isArray(data)) {
          setPokemonCaught(data);
          console.log("data", data);
        } else {
          console.error("Invalid data format:", data);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [dispatch, userId]);

  return (
    <div>
      <h1>My Pokémon</h1>
      {pokemonCaught.length > 0 ? (
        <ul>
          {pokemonCaught.map((pokemon) => (
            <li key={pokemon._id}>
              {`${pokemon.caught_by_user} ${pokemon.pokemon_name} ${pokemon.url_to_sprite}`}
            </li>
          ))}
        </ul>
      ) : (
        <p>No Pokémon caught.</p>
      )}
    </div>
  );
};

export default MyPokemon;
